webpackJsonp([0xdaa0a01d2fce],{7806:function(a,t){a.exports={data:{post:{html:'<p><a href="http://ridethebandwagon.com/"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2007/02/bandwagon-logo.jpg" alt="bandwagon logo" /></a></p>\n<p><a href="http://ridethebandwagon.com/">Bandwagon</a> is a new server that backs up iTunes music libraries from your Mac to Amazon S3 for a flat rate. Sounds like a sensible use of umlimited storage to me.</p>\n<p><strong>Disclosure:</strong> By posting this, they\'re <a href="http://blog.ridethebandwagon.com/2007/02/16/free-accounts-for-bloggers/">giving me a free one-year account</a>. (via <a href="http://www.aaronsw.com/weblog/bandwagon">Aaron Swartz</a>)</p>\n<p><strong>Update:</strong> If you do the the link, make sure you make your own copy of the logo... as <a href="http://www.papascott.de/archives/2007/02/19/bandwagon/#comment-34134">Shelley points out</a> in the commments, images from <a href="http://flickr.com/">Flickr</a> can only link back to Flickr.</p>',fields:{title:"Bandwagon",date:"19 Feb 2007",url:"https://papascott.de/2007-02-19-bandwagon/"}}},pathContext:{slug:"/2007-02-19-bandwagon/",prev:{fields:{title:"Hanging Out With The Goats",date:"18 Feb 2007",slug:"/2007-02-18-hanging-out-with-the-goats/"}},next:{fields:{title:"Fasching, the morning of",date:"19 Feb 2007",slug:"/2007-02-19-fasching-the-morning-of/"}}}}}});
